import React from "react";
import { Link } from "react-router-dom";
import ReactPlayer from "react-player";
import quizOneBackground from "../visuals/quiz/q1_background.mp4";
import title from "../visuals/quiz/q3/title.png";

export default function questionThree() {
  return (
    <div className="questionContainer">
      <ReactPlayer
        className="react-player quiz-video"
        url={quizOneBackground}
        width="100%"
        height="100%"
        controls={false}
        loop={true}
        playing={true}
      />
      <img src={title} alt="" />
      <div className="questionThree_container">
        <div className="row">door 1</div>
        <div className="row">door 2</div>
        <div className="row">door 3</div>
      </div>
      <Link to="/question-three">Room three </Link>
    </div>
  );
}
